const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XX", "p": 459}, {"t": "text", "c": ["- Je suis seul\u2026 je suis seul\u2026 je suis seul\u2026 r\xE9pondit l\u2019\xE9cho."], "p": 459}, {"t": "text", "c": ["\xAB Quelle dr\xF4le de plan\xE8te ! pensa-t-il alors. Elle est toute s\xE8che, et toute pointue et toute sal\xE9e.", "Et les hommes manquent d\u2019imagination. Ils r\xE9p\xE8tent ce qu\u2019on leur dit\u2026", "Chez moi j\u2019avais une fleur : elle parlait toujours la premi\xE8re\u2026 \xBB"], "p": 460}, {"t": "text", "c": ["Mais il arriva que le petit prince, ayant longtemps march\xE9 \xE0 travers les sables, les rocs et les neiges, d\xE9couvrit enfin une route.", "Et les routes vont toutes chez les hommes."], "p": 462}, {"t": "text", "c": ["- Bonjour, dit-il."], "p": 463}, {"t": "text", "c": ["C\u2019\xE9tait un jardin fleuri de roses."], "p": 464}, {"t": "text", "c": ["- Bonjour, dirent les roses."], "p": 465}, {"t": "text", "c": ["Le petit prince les regarda. Elles ressemblaient toutes \xE0 sa fleur."], "p": 466}, {"t": "text", "c": ["- Qui \xEAtes-vous ? leur demanda-t-il, stup\xE9fait. - Nous sommes des roses, dirent les roses."], "p": 468}, {"t": "text", "c": ["- Ah ! fit le petit prince\u2026"], "p": 469}]}';export{e as default};
